import React from 'react';
import './Unit.css';

function Unit({ unit, subUnitList }){
    const unitNames = ['Introduction to Data Science and Supervised Learning', 'Unsupervised Learning and Ot']
    return (
        <div className="unit">
            <h2>Unit {unit} - </h2>
            <ul>{subUnitList}</ul>
        </div>
    );
};
export default Unit;
